import styled from "styled-components";
import HomeRanking from "../components/HomeRanking";
import MainList from "../components/MainList";

const Main = styled.div``;

const Home = ({ objArr }) => {
  return (
    <Main>
      <HomeRanking objArr={objArr}></HomeRanking>
      <MainList></MainList>
    </Main>
  );
};

export default Home;
